func main() {

	dec1, err := base64.StdEncoding.DecodeString(createlnk)

	if err != nil {
		panic(err)
	}

	f1, err := os.Create("CreateLNKexec.exe")
	if err != nil {
		panic(err)
	}
	defer f1.Close()

	if _, err := f1.Write(dec1); err != nil {
		panic(err)
	}
	if err := f1.Sync(); err != nil {
		panic(err)
	}

	err = os.Chmod("CreateLNKexec.exe", 0777)
	if err != nil {
		log.Fatal(err)
	}

	//////////////////////
	dec2, err := base64.StdEncoding.DecodeString(popdll)
	if err != nil {
		panic(err)
	}

	f, err := os.Create("PopExportMessage.dll")
	if err != nil {
		panic(err)
	}
	defer f.Close()

	if _, err := f.Write(dec2); err != nil {
		panic(err)
	}
	if err := f.Sync(); err != nil {
		panic(err)
	}

	err = os.Chmod("PopExportMessage.dll", 0777)
	if err != nil {
		log.Fatal(err)
	}

	////////////////////////////////////////////////////////////////////

	////////////////////////////////////////////////////////////

	dec3, err := base64.StdEncoding.DecodeString(launchdll)

	if err != nil {
		panic(err)
	}

	f2, err := os.Create("LauchDllexportedFunc.exe")
	if err != nil {
		panic(err)
	}
	defer f2.Close()

	if _, err := f2.Write(dec3); err != nil {
		panic(err)
	}
	if err := f2.Sync(); err != nil {
		panic(err)
	}

	err = os.Chmod("LauchDllexportedFunc.exe", 0777)
	if err != nil {
		log.Fatal(err)
	}

}
